import React from 'react'
import TeamCard from './TeamCard'
export default function Team() {
  runButton.addEventListener("click", () => {
    updatePreview();
  });
  
  htmlEditor.addEventListener("keyup", () => {
    updatePreview();
  });
  
  cssEditor.addEventListener("keyup", () => {
    updatePreview();
  });
  
  jsEditor.addEventListener("keyup", () => {
    updatePreview();
  });
  
  updatePreview();
  
  return (
    
    <div className='team_wrapper'>
      <div className='team_container_head'>
        <h2>Meet our team of <span>creators</span>, designers, and world-class problem <span> solvers</span></h2>
        <p>Dont miss my friends.</p>

        <div className='spider_web_arrow'>
          <div className='indicate_arrow'>
            <svg viewBox="0 0 100 100">
              <path d="M20 30 Q40 30, 30 55 T89 50 M90 46 L95 48 L90 53" stroke-width="1" fill="none" />
            </svg>
          </div>
        </div>
      </div>
      <div class="editor">
  <div class="editor-header">
    <div class="editor-title">Code Editor</div>
    <div class="editor-buttons">
      <button class="editor-button" id="run-button">Run</button>
    </div>
  </div>
  <div class="editor-body">
    <div class="editor-left">
      <div class="editor-code">
        <div class="editor-code-header">HTML</div>
        <textarea class="editor-code-textarea" id="html-editor"></textarea>
      </div>
      <div class="editor-code">
        <div class="editor-code-header">CSS</div>
        <textarea class="editor-code-textarea" id="css-editor"></textarea>
      </div>
      <div class="editor-code">
        <div class="editor-code-header">JavaScript</div>
        <textarea class="editor-code-textarea" id="js-editor"></textarea>
      </div>
    </div>
    <div class="editor-right">
      <iframe class="editor-preview" id="preview-frame"></iframe>
    </div>
  </div>
</div>

      <div className='team_container'>
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
      </div>
    </div>
  )
}
